var buttonLike=document.querySelectorAll(".catalog__card-like");const onButtonLikeClick=()=>{buttonLike.forEach((t=>{t.addEventListener("click",(function(){t.classList.contains("catalog__card-like--active")?t.classList.remove("catalog__card-like--active"):t.classList.add("catalog__card-like--active")}))}))};export{onButtonLikeClick};